

with open('./input_five.txt', 'r') as f:
    text = f.read()
    

def react(a, b):
    if ((a != b) and (a.lower() == b.lower())):
        return True


def scan(line):
    lst = []
    for i in line:
        if lst and react(i, lst[-1]):
            lst.pop()
            
        else:
            lst.append(i)
    return len(lst)



#print(scan(''))

elements = set([c.lower() for c in text])

print(min([scan(text.replace(a, '').replace(a.upper(), '')) for a in elements]))